var baseUrl = '';
function toVrdObject(value) {
 return eval(`api.${value.type}(value)`);
}
function toVrdObjectArray(value) {
 var result = [];
 for (var i = 0; i < value.length; i++) {
  result.push(toVrdObject(value[i]));
 }
 return result;
}
function apiRequest(url, data = {}) {
 return fetch(baseUrl + '/api/' + url, {
  method: 'POST',
  mode: 'cors',
  cache: 'no-cache',
  credentials: 'same-origin',
  headers: {
   'Content-Type': 'application/json'
  },
  redirect: 'follow',
  referrerPolicy: 'no-referrer',
  body: JSON.stringify(data)
 })
 .then((response) => response.ok ? response.text() : '')
 .then((text) => JSON.parse(text))
 .catch((err) => {
  console.log(`Error for api request`, url, err);
 });
}
function apiRequestVrdObject(url, data = {}) {
 return apiRequest(url, data)
 .then((value) => {
  if (Array.isArray(value)) {
   return toVrdObjectArray(value);
  } else {
   return toVrdObject(value);
  }
 });
}
function apiSignal(path, instance, callback) {
 var result = {};
 var location = new URL(baseUrl || window.location.origin);
 var wsProtocol = location.protocol === 'https:' ? 'wss:' : 'ws:';
 var url = `${wsProtocol}//${location.host}/apiSignal/${path}`;
 result.socket = new WebSocket(url);
 result.socket.onopen = () => result.socket.send(JSON.stringify(instance));
 result.socket.onmessage = (msg) => {callback(JSON.parse(msg.data));};
 result.disconnect = () => {result.socket.close()};
 return result;
}
